// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract FundTransfer {
    uint256 public numOfFunders;
    mapping(uint256 => address) public Funders;

    receive() external payable {}

    function depositMoney() external payable {
        Funders[numOfFunders] = msg.sender;
    }

    function withdrawMoney(uint256 _amount) external {
        require(
            _amount < 2000000000000000000,
            "you cannot withdraw more than 2 ethers"
        );
        payable(msg.sender).transfer(_amount);
    }
}
